import React from "react";
import styled from "styled-components";

type ProductProps = {
  img: string;
  title: string;
};

export default function Product({ img, title }: ProductProps) {
  const ProductContainer = styled.div`
    width: 300px;
    height: 400px;
    position: -webkit-sticky; /* Safari */
    display: flex;
    justify-content: space-around;
    flex-flow: column wrap;
    border: 1px solid orange; /* BORDER TEST*/
  `;
  const Img = styled.img`
    width: 300px;
    height: 300px;
    border-radius: 10px;
  `;
  const Title = styled.div`
    font-size: 1.5em;
    font-weight: 600;
    font-style: normal;
  `;
  const TextS = styled.div`
    font-size: 1em;
    font-family: Livvic;
    font-style: normal;
    font-weight: 500;
    font-style: normal;
  `;
  const Star = styled.div`
    width: 160px;
    height: 16px;
  `;
  return (
    <ProductContainer>
      <Img src={img} alt={title}></Img>
      <Title>{title}</Title>
      <TextS>Blue Orca Coffee</TextS>
      <TextS>$20.00</TextS>
    </ProductContainer>
  );
}
